import React from "react";

// export a home page component
export default class Item extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        columnnum: 0,
        rownum : 0,
        key: ''
    };
    //this.recurTrial=this.recurTrial.bind(recurTrial);
  }

  render() {
    return (
      <div className="Item" columnnum={this.state.columnnum} rownum={this.state.rownum}>
      </div>
        );
  }
}
